text:
У нас есть некоторые *рекомендации*, которые помогут сделать общение в онлайне комфортным для всех:

• укажите свои имя и фамилию полностью и на русском языке, чтобы было ясно, к кому обращаться во время беседы;
• будьте вовремя (ждём не больше 5 минут);
• отключайте микрофон, если не говорите сейчас;
• включите видео на все время трансляции, чтобы можно было говорить с вами, а не с черным экраном (можно отключать при необходимости, но ненадолго);
• будьте вежливы со всеми участниками встречи
